import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 19.2-5 Meaning of certain terms.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-5.md","filePath":"vacode/19.2-5.md"}'),i={name:"vacode/19.2-5.md"},o=r('<h1 id="§-19-2-5-meaning-of-certain-terms" tabindex="-1">§ 19.2-5 Meaning of certain terms. <a class="header-anchor" href="#§-19-2-5-meaning-of-certain-terms" aria-label="Permalink to &quot;§ 19.2-5 Meaning of certain terms.&quot;">​</a></h1><p>As used in this title, unless otherwise clearly indicated by the context in which it appears:</p><p>&quot;Court&quot; means any court vested with appropriate jurisdiction under the Constitution and laws of the Commonwealth.</p><p>&quot;Court not of record&quot; and &quot;district court&quot; shall have the respective meanings assigned to them in Chapter 4.1 (§ <a href="http://law.lis.virginia.gov/vacode/16.1-69.1/" target="_blank" rel="noreferrer">16.1-69.1</a> et seq.) of Title 16.1.</p><p>&quot;Judge&quot; means any judge, associate judge or substitute judge of any court or any magistrate.</p><p>Code 1950, § 19.1-5; 1960, c. 366; 1975, c. 495; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0839" target="_blank" rel="noreferrer">839</a>; 2008, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0551" target="_blank" rel="noreferrer">551</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0691" target="_blank" rel="noreferrer">691</a>.</p>',6),n=[o];function s(c,l,d,p,u,h){return t(),a("div",null,n)}const f=e(i,[["render",s]]);export{g as __pageData,f as default};
